import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faEye } from '@fortawesome/free-solid-svg-icons';

const ItemDetail = ({animalDetail}) => {
    return (
        <div className="card product row margin">
            <img src={animalDetail.pictureUrl} className="card-img-top" alt={animalDetail.name} />
            <div className="card-body">
                <h4 className="card-title">{animalDetail.name}</h4>
                <p className="card-text">{animalDetail.description}</p>
                <h5>$ {animalDetail.price}</h5>
                <a href="/" className="btn btn-productos"><FontAwesomeIcon icon={faEye} /></a>
            </div>
        </div>
    )
}

export default ItemDetail
